def c_s(node):
    # 取node列表里前56个元素
    node_first_56 = node[:56]

    # 计算Common (交集)
    common = list(set(node_first_56) & set(hub))

    # 计算Specific (差集)
    specific = list(set(node_first_56) - set(common))
    print("KBRs:", node_first_56)
    print("Common:", common)
    print("Specific:", specific)
    print("non-overlapping hub", list(set(hub)-set(common)))

